import React from 'react';

const Note = ({ text, onDelete }) => {
  return (
    <div className="note">
      <p>{text}</p>
      <button onClick={onDelete}>
        <span className="material-icons-outlined"></span>
      </button>
    </div>
  );
};

export default Note;
